

import React from 'react';
import './NewArrivals.css';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import { Carousel } from 'react-responsive-carousel';
import 'react-responsive-carousel/lib/styles/carousel.min.css';
import Info from '../components/Getintouch';
import Footer from '../components/Footer';







  
const NewArrivals = () => {
 
  const newProducts = [
    // Your product data goes here
    { id: 1, name: 'Green stone', price: 49.99, image: 'data:image/jpeg;base64,' },
    { id: 2, name: 'Green Stone', price: 29.99, image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR3BRz3QMpWsQZrulmFJob3rC7oX_4AKDQV_g&usqp=CAU',"description": " Talc Powder is of high purity, high whiteness, glossy, transparent and translucent, produced exclusively from best source of mines in India to ensure consistency and traceability. We also manufacture Talc Powder that can be used in surface coatings including flat emulsion surface coatings",  },
    { id: 2, name: 'Soap Stone', price: 89.99, image: 'data:image/jpeg;base64,' },
    { id: 2, name: 'Rough Talc', price: 49.99, image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRh63V2qBrtufXir0u8v2NvVetKPX_aSRjl7A&usqp=CAU' },
    { id: 2, name: 'Steatite', price: 29.99, image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ5r2-Mvw9p45ui0PUEOumvS2MAOIYO0Tw_fw&usqp=CAU' },
    { id: 2, name: 'Talcum Powder', price: 19.99, image: 'https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTwlWvY8pyCkqd2wWnlozVylJMGi2IJ0qX_5g&usqp=CAU' },
    
   
  ];




 return (
  <div className="new-arrivals">
  <h2>New Arrivals</h2>

  <Carousel
      showArrows={true}
      showThumbs={true}
      showStatus={true}
      showIndicators={true} // Hide the indicators (dots) 
      infiniteLoop={true} //  infinite loop
      centerMode={true} //  active slide
      centerSlidePercentage={40} // 2 items per slide
    >
    {newProducts.map((product, index) => (
      <div key={product.id} className="product-card">
        <div className="product-image">
          <img src={product.image} alt={product.name} />
          <div className="new-label">New</div>
          <div className="overlay">
            <div className="discount-label">-33% off</div>
          </div>
        </div>
        <div className="product-details">
          <h3>{product.name}</h3>
          <p> Talc Powder is of high purity, high whiteness, glossy, transparent and translucent.</p>
          <p>${product.price.toFixed(2)}</p>
          <button className="add-to-cart">Add to Cart</button>
        </div>
       
      </div>
       
    ))}
   
  </Carousel>
  <Info />
<Footer />

</div>
);
}
export default NewArrivals;

